import './App.css';
import "./Pages/Home"
import { BrowserRouter, Routes, Route, useNavigate } from "react-router-dom";
import React, { useContext, useEffect, useState } from 'react';

import { AuthContext } from './Context/AuthContext';
import Home from './Pages/Home';
import Login from './Pages/BackOfiice/Login';
import Sidebar from './Pages/Components/Sidebar';
import Booking from './Pages/BackOfiice/Booking/Booking';
import HomeBackOffice from './Pages/BackOfiice/HomeBackOffice';
import Local from './Pages/BackOfiice/Local/Local';
import Admin from './Pages/BackOfiice/Admin/Admin';
import Error from "./Pages/Error"
import ChangeDate from "./Pages/ModifyBooking/ChangeDate"
import Header from './Pages/Components/Header';
import Footer from './Pages/Components/Footer';
import Reserve from './Pages/Steps/Reserve';
import DeleteBooking from './Pages/ModifyBooking/DeleteBooking';
import EditLocal from './Pages/BackOfiice/Local/EditLocal';
import CreateLocal from './Pages/BackOfiice/Local/CreateLocal';
import Service from './Pages/BackOfiice/Service/ServiceData';
import ServiceData from './Pages/BackOfiice/Service/ServiceData';
import CreateServiceData from './Pages/BackOfiice/Service/CreateServiceData';
import EditServiceData from './Pages/BackOfiice/Service/EditServiceData';
import NewProfile from './Pages/BackOfiice/Admin/Perfiles';
import LocalBookingAdmin from './Pages/BackOfiice/Admin/LocalBookingAdmin';

function App() {


  const { user } = useContext(AuthContext);
  //const navigate = useNavigate();

  /*useEffect(() => {
    if (!user) {
      navigate('/');
    }
  }, [user]);*/


  return (

    <Routes>
      <Route index element={<Home />} />
      <Route path="/reserve" element={<Reserve />} />
      {!user && <Route path="/login" element={<Login />} />}
      {user && <Route path="/local" element={<Local />} />}
      {user && <Route path="/booking" element={<Booking />} />}
      {user && <Route path="/homeBackOficce" element={<HomeBackOffice />} />}
      {user && <Route path="/editLocal/:id" element={<EditLocal />} />}
      {user && <Route path="/createLocal" element={<CreateLocal />} />}
      {user && <Route path="/editLocal/:id" element={<EditLocal />} />}
      {user && <Route path="/servicios" element={<ServiceData />} />}
      {user && <Route path="/servicios/crearServicio" element={<CreateServiceData />} />}
      {user && <Route path="/editarServicio/:id" element={<EditServiceData />} />}
      {user && user.perfil === "Administrador" && <Route path="/perfiles" element={<NewProfile />} />}
      {user && user.perfil === "Administrador" && <Route path="/administrarHorarios" element={<LocalBookingAdmin />} />}
      <Route path="/modify/:token" element={<ChangeDate />} />
      <Route path="/delete/:token" element={<DeleteBooking />} />
      {user && user.perfil === "Administrador" && <Route path="/admin" element={<Admin />} />}
      {!user && < Route path="/delete/:token" element={<DeleteBooking />} />}
      <Route path="*" element={<Home />} />

    </Routes>


  );
}

export default App;
